import React from 'react';

function ActionButton({ label, imgSrc, altText }) {
  return (
    <button className="flex gap-2 justify-center px-3 py-2 rounded-xl border border-blue-500 border-solid">
      <span>{label}</span>
      <img loading="lazy" src={imgSrc} alt={altText} className="shrink-0 my-auto w-4 aspect-square" />
    </button>
  );
}

export default ActionButton;
